__NUXT_JSONP__("/drugs/Marimastat", (function(a,b){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"154039-60-8",chebiId:"CHEBI:50662",chemicalFormula:"C15H29N3O5",definition:"An orally-active synthetic hydroxamate with potential antineoplastic activity.  Marimastat covalently binds to the zinc(II) ion in the active site of matrix metalloproteinases (MMPs), thereby inhibiting the action of MMPs, inducing extracellular matrix degradation, and inhibiting angiogenesis, tumor growth and invasion, and metastasis.  This agent may also inhibit tumor necrosis factor-alpha converting enzyme (TACE), an enzyme involved in tumor necrosis factor alpha (TNF-alpha) production that may play a role in some malignancies as well as in the development of arthritis and sepsis.",fdaUniiCode:"D5EQV23TDS",identifier:"C1652",preferredName:a,semanticType:"Organic Chemical",subclassOf:["C1970"],synonyms:["(2S,3R)-3-(((1S)-2,2-Dimethyl-1-(methylcarbamoxy)propyl)carboyl)-2-hydroxy-5-methylhexanohydroxamic Acid","(2S,3R)-3-{(S)-[2,2-Dimethyl-1-(methylcarbamoyl) propyl]carbamoyl}-2-hydroxy-5-methylhexanohydroxamic acid","BB 2516","BB-2516","MARIMASTAT",a,"Marimistat","TA-2516","marimastat"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FMarimastat",extension:".json",createdAt:b,updatedAt:b}}],fetch:{},mutations:void 0}}("Marimastat","2021-10-30T13:35:43.033Z")));